    "def analyze_specific_terms(df, terms):\n",
    "    \"\"\"\n",
    "    ç‰¹å®šã®å˜èªã‚„ãƒ•ãƒ¬ãƒ¼ã‚ºã®ä½¿ç”¨å‚¾å‘ã‚’åˆ†æã™ã‚‹é–¢æ•°\n",
    "    \n",
    "    Parameters:\n",
