    "        åˆ†æå¯¾è±¡ã®ãƒ‡ãƒ¼ã‚¿ãƒ•ãƒ¬ãƒ¼ãƒ \n",
    "    terms : list\n",
    "        åˆ†æã—ãŸã„å˜èªã‚„ãƒ•ãƒ¬ãƒ¼ã‚ºã®ãƒªã‚¹ãƒˆ\n",
    "    \"\"\"\n",
    "    # çµæœã‚’æ ¼ç´ã™ã‚‹è¾æ›¸\n",
