    "        # ãƒ©ãƒ™ãƒ«ã”ã¨ã®ãƒ†ã‚­ã‚¹ãƒˆã‚’å–å¾—\n",
    "        texts = df[df['label'] == label]['text'].str.lower()\n",
    "        \n",
    "        for term in terms:\n",
    "            term_lower = term.lower()\n",
    "            # å˜èªã®å ´åˆ\n",
    "            if ' ' not in term:\n",
    "                pattern = r'\\b' + re.escape(term_lower) + r'\\b'\n",
    "            # ãƒ•ãƒ¬ãƒ¼ã‚ºã®å ´åˆ\n",
    "            else:\n",
    "                pattern = r'(?:^|\\s)' + re.escape(term_lower) + r'(?:$|\\s)'\n",
    "            \n",
    "            # å„ãƒ†ã‚­ã‚¹ãƒˆã§ã®å‡ºç¾å›æ•°ã‚’ã‚«ã‚¦ãƒ³ãƒˆ\n",
    "            count = sum(len(re.findall(pattern, str(text))) for text in texts)\n",
    "            \n",
    "            # ã“ã®è¡¨ç¾ã‚’å«ã‚€è¡Œæ•°ã‚’ã‚«ã‚¦ãƒ³ãƒˆ\n",
    "            rows_with_term = sum(texts.str.contains(pattern, regex=True, na=False))\n",
    "            \n",
    "            # çµæœã‚’ä¿å­˜\n",
    "            term_usage[term]['total'] += count\n",
    "            term_usage[term]['by_label'][label] = {\n",
    "                'count': count,\n",
